import Layout from '../components/mylayout';
import fetch from 'isomorphic-unfetch';

import Link from 'next/link';

const PostLink = props => (
  <li>
    <Link href="/p/[id]" as={`/p/${props.id}`}>
      <a>{props.id}</a>
    </Link>
  </li>
);

 function Blog() {

  return (
    <Layout>
      <h1>My Blog</h1>
      <ul>
        <PostLink id="hello-nextjs" />
        <PostLink id="learn-nextjs" />
        <PostLink id="deploy-nextjs" />
      </ul>
    </Layout>
  );
}


const Index = props => (
    <Layout>
      <h1>Batman TV Shows</h1>
      <ul>
        {props.shows.map(show => (
          <li key={show.id}>
            <Link href="/p/[id]" as={`/p/${show.id}`}>
              <a>{show.name}</a>
            </Link>
          </li>
        ))}
      </ul>
    </Layout>
  );

  Index.getInitialProps = async function() {

    const res = await fetch('http://fundoonotes.incubation.bridgelabz.com/api/notes/getNotesList',{ headers: {
        'Authorization': {token:'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJlbWFpbCI6Im1pbmVzaEBnbWFpbC5jb20iLCJpYXQiOjE1ODE3NTk0MTIsImV4cCI6MTY2ODE1OTQxMn0.SKJ1hxDpC4otgSWTlcqVQJ5pzVcHYXsIBpqHH--WAJs'}
    }});


    const data = await res.data.json();

    // console.log(res.data['data']);
    console.log(`Show data fetched. Count: ${data}`);

    return {

      shows: data.map(entry => entry.show)
    };
  };

  export default Index;
